import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";

function Products() {
  const [list, setList] = useState([]);
  //get all items
  const getList = async () => {
    try {
      const response = await fetch("http://localhost:3001/products", {
        method: "GET",
        headers: { "Content-Type": "application/json" },
      });
      console.log(response);
      const jsonDate = await response.json();
      console.log(jsonDate);
      setList(jsonDate);
    } catch (error) {
      console.log(error.message);
    }
  };
  useEffect(() => {
    getList();
  }, []);

  return (
    <div>
      <h1 class="container pb-2 border-bottom">Products</h1>
      <div class="container">
        <div class="dropdown m-5">
          <a
            class="btn btn-secondary dropdown-toggle"
            href="/"
            role="button"
            data-bs-toggle="dropdown"
            aria-expanded="false"
          >
            Dropdown link
          </a>

          <ul class="dropdown-menu">
            <li>
              <a class="dropdown-item" href="/">
                Action
              </a>
            </li>
            <li>
              <a class="dropdown-item" href="/">
                Another action
              </a>
            </li>
            <li>
              <a class="dropdown-item" href="/">
                Something else here
              </a>
            </li>
          </ul>
        </div>
        <div class="dropdown m-5">
          <a
            class="btn btn-secondary dropdown-toggle"
            href="/"
            role="button"
            data-bs-toggle="dropdown"
            aria-expanded="false"
          >
            Dropdown link
          </a>

          <ul class="dropdown-menu">
            <li>
              <a class="dropdown-item" href="/">
                Action
              </a>
            </li>
            <li>
              <a class="dropdown-item" href="/">
                Another action
              </a>
            </li>
            <li>
              <a class="dropdown-item" href="/">
                Something else here
              </a>
            </li>
          </ul>
        </div>
      </div>
      <div class="row justify-content-evenly">
        {list.map((item, index) => (
          <div class="col-3 mt-5" key={index}>
            <div class="media d-block d-sm-flex text-sm-left">
              <a class="cart-item-thumb mx-auto mr-sm-4" href="/">
                <img src={item.link} alt={item.title} className="fixed-img" />
              </a>
              <div class="p-4">
                <h4 class="text-dark">
                  <Link className="page-link" to={`/product/${item.id}`}>
                    {item.title}
                  </Link>
                </h4>
                <div class="font-size-sm">
                  <span class="text-muted mr-2"></span>
                  {item.brand}
                </div>
                <div class="font-size-sm">
                  <span class="text-muted mr-2">SPF:</span>
                  {item.spf}
                </div>
                <div
                  class="font-size-lg text-primary pt-2"
                  className={` ${
                    item.is_safe ? "badge text-bg-info" : "badge text-bg-danger"
                  }`}
                >
                  {item.is_safe ? " Safe " : "Danger"}
                </div>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Products;
